import React, { useEffect, useState } from "react";
import API from "../api/axios";
import { useNavigate } from "react-router-dom";

const SchoolDashboard = () => {
  const [school, setSchool] = useState(null);
  const [teams, setTeams] = useState([]);
  const [players, setPlayers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchDashboard = async () => {
      try {
        setLoading(true);
        // 1. Get school info
        const schoolRes = await API.get("/schools/me");
        setSchool(schoolRes.data);

        // 2. Get all teams for this school
        const teamsRes = await API.get("/teams");
        setTeams(teamsRes.data.teams || []);

        // 3. Get all players (if you have /api/players?school_id=, use that)
        const playersRes = await API.get("/players");
        setPlayers(playersRes.data.players || []);

      } catch (err) {
        setError("Failed to load dashboard: " + (err.response?.data?.message || err.message));
      } finally {
        setLoading(false);
      }
    };

    fetchDashboard();
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    navigate("/login");
  };

  if (loading) return <div className="p-8 text-center">Loading dashboard...</div>;
  if (error) return <div className="p-8 text-center text-red-600">{error}</div>;

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold">
          {school?.name || "School"} Dashboard
        </h1>
        <button
          className="bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded"
          onClick={handleLogout}
        >
          Logout
        </button>
      </div>

      <div className="mb-8 bg-white p-4 rounded shadow">
        <h2 className="font-semibold text-lg mb-2">School Info</h2>
        <p><strong>Name:</strong> {school?.name}</p>
        <p><strong>Address:</strong> {school?.address}</p>
        <p><strong>Email:</strong> {school?.email}</p>
        <p><strong>Phone:</strong> {school?.phone}</p>
        <p><strong>Province:</strong> {school?.province}</p>
      </div>

      <div className="mb-8 bg-white p-4 rounded shadow">
        <h2 className="font-semibold text-lg mb-2">Teams</h2>
        <ul className="list-disc pl-6">
          {teams.map((team) => (
            <li key={team.id}>{team.name} ({team.sport})</li>
          ))}
        </ul>
      </div>

      <div className="mb-8 bg-white p-4 rounded shadow">
        <h2 className="font-semibold text-lg mb-2">Players</h2>
        <ul className="list-disc pl-6">
          {players.map((player) => (
            <li key={player.id}>{player.full_name} ({player.gender})</li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default SchoolDashboard;
